import React from "react";
import ReactDOM from "react-dom";

const firstName = "Sushant";
const lastName = "Dahal";

ReactDOM.render(
  <>
    <h1>My name is {firstName + "" + lastName}</h1>
  </>,
  document.getElementById("root")
);
